import { Box, Button, TextField, Typography } from '@mui/material'
import React from 'react'

const Signup = () => {
    const handlesubmit = () => { };
    return (
        <div>

            <form onSubmit={handlesubmit}>
                <Box marginLeft="auto" marginRight="auto" width={300}
                    display='flex' flexDirection={'column'}
                    justifyContent="center" alignItems="center" >
                    <Typography variant='h2'>SIGNUP</Typography>
                    <TextField variant='outlined' placeholder='name' margin='normal' />
                    <TextField variant='outlined' placeholder='Your@gmail' margin='normal' />
                    <TextField variant='outlined' placeholder='Password' margin='normal' />
                    <Button variant='contained' type='submit'>Submit</Button>
                </Box>
            </form>
        </div>
    )
}

export default Signup
